import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import navbar from "./components/Navbar/navbar.js"
import MyMixer from "./pages/MyMixer.js"
function App() {
  return (
    <Router>
      <navbar />
      <Switch>
        <Route path='/' exact component={MyMixer} />
      </Switch>
    </Router>
  );
}

export default App;
